textOriginal:
O que eu espero do futuro governo Lula:
1) Volta do imposto sindical - Lula terá possivelmente que agradar a pelegada, que está sedente pela volta deste dinheiro fácil de novo no cofrinho;
2) Fim do teto de gastos. Voltaremos novamente aos gastos desenfreados. Um exemplo foi o FIES, que, em um primeiro momento foi bom para colocar gente humilde nas universidades, mas, que deixou um PASSIVO BILIONÁRIO, que Bolsonaro teve que anistiar mais de 90%, eis que milhares de ex-estudantes estavam com o nome sujo;
3) Vai ter que soltar muito dinheiro para "convencer" o Congresso, que está bem bolsonarista. Sinceramente, não duvido nada que teremos uma espécie de MENSALÃO 2.0;
4) Legalização do aborto e drogas - No STF, já há uma ação do PSOL neste sentido. Com a capacidade de colocar mais 2 ministros ali na casa, com viés esquerdista, não duvido nada, estes 2 se juntarem a maioria que já foi escolhida pelos governos petistas, e derrubar a proibição do aborto e, possivelmente, legalizar em parte as drogas;
5) Mais grana para as entidades ligada ao MST. Assim, possivelmente veremos mais invasões de terra;
6) Um revanchismo/vingança de Lula para cima daqueles que o atacaram ou das autoridades que o botaram quase 2 anos em cana;
7) A perpetuação da pobreza dos 20 milhões de miseráveis que moram na Amazônia. Já que Lula fechou com os europeus de adotar a pauta "ambientalista" deles. Inclusive, o presidente Macron, da França, já deu os parabéns a Lula, dizendo que quer trabalhar junto;
😎 Mais divisão social, com manipulação dos grupos minoritários, que serão utilizados possivelmente como puxadinhos do PT. Na prática, não resolve NENHUMA questão destes grupos sociais, pois qualquer pessoa que já estudou ciência política, como eu, sabe perfeitamente que os movimentos sociais se enfraquecem quando se ligam a governos.
